import React, { useContext, createRef } from 'react';
import { AppState } from '../context';
import { Grid, Header, Container, Card, Menu, Segment, Sticky } from 'semantic-ui-react';

const HomePage = () => {
  const state = useContext(AppState);
  const { data } = state;
  const contextRef = createRef();
  console.log(data);
  return (
    <div ref={contextRef}>
      <Sticky context={contextRef}>
        <PageHeader />
      </Sticky>
      <Container>
        <Header content="test content" />
      </Container>
    </div>
  );
};

const PageHeader = () => {
  return (
    <Segment
      basic
      attached='top'
      style={{ backgroundColor: "orange", textAlign: "center" }}
      fluid
    >
      <Header content="Marketplace" size="large" />
    </Segment>
  );
}
export default HomePage;
